import React from 'react'
import Navbar from './Component/Navbar';
import Home from './Component/Home';
import Footer from './Component/Footer';
import ContextData from './Context/ContextData';

function App() {
  return (
    <>
      <ContextData>
      <Navbar/>
      <Home/>
      <Footer/></ContextData>

    </>

  )
}

export default App;
